import Roster from "./Roster";

function RosterList({ rosters, user }) {

    return(
        <ul>
        {rosters.map((roster) => {
            if (roster.coach_id === user.id) {
                return(
                    <Roster
                        key={roster.id}
                        players={roster.players}
                        level={roster.level}
                        coach={roster.coach.first_name}
                        roster_size={roster.roster_size}
                        team={roster.team}
                    />
                )
            }
        })}
        </ul>
    )
}
export default RosterList;
